fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:46_xx_gonadal_dysgenesis rdfs:subClassOf :gonadal_dysgenesis ;
    :has_definition "A gonadal dysgenesis that is characterized by the lack of functional ovaries to induce puberty in an otherwise 46,XX female." ;
    :has_exact_synonym "ovarian dysgenesis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperkalemic_periodic_paralysis rdfs:subClassOf :familial_periodic_paralysis ;
    :has_exact_synonym "familial hyperkalemic periodic paralysis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:farmer_s_lung rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        :extrinsic_allergic_alveolitis ;
    :has_definition "An extrinsic allergic alveolitis which is induced by the inhalation of spores (Aspergillus sp and thermophilic actinomycetes) in dust from moldy hay or straw. It is characterized by sudden onset, fever, cough, expectoration, and breathlessness." ;
    :has_exact_synonym "Farmers lung"@en,
        "farmer lung"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brucella_melitensis_brucellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :brucella_melitensis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :backache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        :brucellosis ;
    :has_definition "A brucellosis that involves an infection caused by Brucella melitensis [NCBITaxon:29459] in cattle, goats, sheep and humans. The disease has_symptom fever, has_symptom malaise, has_symptom anorexia, has_symptom limb pain and has_symptom back pain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brucella_abortus_brucellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :brucella_abortus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        :brucellosis ;
    :has_definition "A brucellosis that involves an infection caused by Brucella abortus [NCBITaxon:235] in cattle and humans. The disease has_symptom fever, has_symptom chills, has_symptom sweats, has_symptom weight loss, has_symptom malaise, has_symptom headaches, has_symptom myalgia, and has_symptom arthralgia." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemangioma_of_orbit rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :endothelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :orbital_region ],
        :orbital_disease ;
    :has_exact_synonym "Angioma of the orbit"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cavernous_hemangioma_of_orbit rdfs:subClassOf :cavernous_hemangioma ;
    :has_exact_synonym "Cavernous Angioma of orbit"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuroleptic_malignant_syndrome rdfs:subClassOf :nervous_system_disease ;
    :has_definition "A nervous system disease that is characterized by hyperthermia, muscular rigidity, autonomic dysfunction and altered consciousness and is associated with administration of antipsychotic and other central dopaminergic blockers." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hantavirus_pulmonary_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :orthohantavirus_andesense ;
                            rdf:rest [ rdf:first :orthohantavirus_bayoui ;
                                    rdf:rest [ rdf:first :orthohantavirus_negraense ;
                                            rdf:rest [ rdf:first :orthohantavirus_nigrorivense ;
                                                    rdf:rest [ rdf:first :orthohantavirus_sinnombreense ;
                                                            rdf:rest :nil ] ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :shock ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pulmonary_edema ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :oligoryzomys_longicaudatus ;
                            rdf:rest [ rdf:first :oryzomys_palustris ;
                                    rdf:rest [ rdf:first :sigmodon_hispidus ;
                                            rdf:rest [ rdf:first :myodes_glareolus ;
                                                    rdf:rest [ rdf:first :calomys_laucha ;
                                                            rdf:rest :nil ] ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :pulmonary_infiltrates ],
        :lung_disease,
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results in infection located in lung, has_material_basis_in Orthohantavirus sinnombreense, transmitted by deer mouse (Myodes glareolus), has_material_basis_in Orthohantavirus nigrorivense, transmitted by cotton rat (Sigmodon hispidus), has_material_basis_in Orthohantavirus bayoui, transmitted by marsh rice rat (Oryzomys palustris), has_material_basis_in Orthohantavirus negraense, transmitted by small vesper mouse (Calomys laucha), or has_material_basis_in Orthohantavirus andesense, transmitted by rice rat (Oligoryzomys longicaudatus). The infection has _symptom fever, muscle pain, headache, cough, vomiting, and chills which rapidly progress to bilateral interstitial pulmonary infiltrates occurrence, pulmonary edema and hypoxia often resulting in death from shock or cardiac complications." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pemphigoid_gestationis rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_phenotype ;
                            owl:someValuesFrom :abnormal_immunoglobulin_level ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :zone_of_skin ;
                                                    rdf:rest [ rdf:first :connective_tissue ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ],
        :pemphigoid ;
    :has_definition "A pemphigoid that is characterized by erythematous papules, vesicles, and plaques around the trunk and extremities that develop during pregnancy, particularly during the second and third trimesters, has_symptom pruritis, and has_material_basis_in autoantibodies to the basement membrane, which triggers a complement cascade and attracts eosinophils to the subepidermis." ;
    :has_exact_synonym "Gestational herpes"@en,
        "herpes gestationis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sporotrichosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :sporothrix_schenckii ],
        :primary_systemic_mycosis ;
    :has_definition "A primary systemic mycosis that results_in a systemic fungal infection, has_material_basis_in Sporothrix schenckii in animals and humans and results_in_formation_of red papule at the site of inoculation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ureteral_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :lymphoma,
        :ureter_cancer ;
    :has_exact_synonym "lymphoma of ureter"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:regional_ureteric_cancer rdfs:subClassOf :ureter_carcinoma ;
    :has_exact_synonym "regional Ureteric carcinoma"@en,
        "regional malignant ureteral tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dumping_syndrome rdfs:subClassOf :postgastrectomy_syndrome ;
    :has_exact_synonym "Dumping (jejunal) syndrome"@en,
        "Jejunal syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lipoid_proteinosis rdfs:subClassOf :lipid_metabolism_disorder ;
    :has_exact_synonym "Lipid proteinosis"@en,
        "URBACH-WIETHE DISEASE"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fabry_disease rdfs:subClassOf :sphingolipidosis ;
    :has_definition "A sphingolipidosis that is characterized by the buildup of globotriaosylceramide in the body's cells and has_material_basis_in X-linked inherited mutations in the GLA gene, encoding alpha-galactosidase A, on chromosome Xq22." ;
    :has_exact_synonym "Fabry Disease, Cardiac Variant",
        "Alpha-galactosidase A deficiency"@en,
        "Angiokeratoma Corporis Diffusum"@en,
        "Fabry's disease"@en,
        "alpha galactosidase deficiency"@en,
        "deficiency of melibiase"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fucosidosis rdfs:subClassOf :lysosomal_storage_disease ;
    :has_exact_synonym "A-fucosidase deficiency"@en,
        "alpha fucosidase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sjogren_larsson_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by ichthyosis, mental retardation, spastic paraparesis, macular dystrophy, and leukoencephalopathy, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the aldehyde dehydrogenase 3 family member A2 (ALDH3A2) gene, which encodes fatty aldehyde dehydrogenase, on chromosome 17p11." ;
    :has_exact_synonym "FALDH deficiency"@en,
        "SLS"@en,
        "Sjogren Larsson syndrome"@en,
        "Sjogren-Larsson's syndrome"@en,
        "fatty acid alcohol oxidoreductase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cholesterol_ester_storage_disease rdfs:subClassOf :lysosomal_acid_lipase_deficiency ;
    :has_definition "A lysosomal acid lipase deficiency characterized by onset in childhood or later of progressive accumulation of cholesteryl esters and triglycerides primarily in the liver and spleen." ;
    :has_exact_match "GARD:12099",
        "MESH:D015217",
        "OMIM:278000",
        "ORDO:75234" ;
    :has_exact_synonym "CESD",
        "partial LAL deficiency",
        "partial LIPA deficiency",
        "partial cholesterol ester hydrolase deficiency",
        "partial lysosomal acid lipase deficiency" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuronal_ceroid_lipofuscinosis rdfs:subClassOf :lipid_storage_disease ;
    :has_exact_synonym "hereditary ceroid lipofuscinosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:niemann_pick_disease rdfs:subClassOf :sphingolipidosis ;
    :has_definition "A sphingoliidosis characterized by the accumulation of the lipid sphingomyelin in lysosomes in cells." ;
    :has_exact_synonym "Sphingomyelinase Deficiency Disease"@en,
        "lipoid histiocytosis"@en,
        "sphingomyelin lipidosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peripheral_degeneration_of_cornea rdfs:subClassOf :corneal_degeneration ;
    :has_exact_synonym "peripheral degenerations of cornea"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:candidal_paronychia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :nail ],
        :candidiasis,
        :nail_disease ;
    :has_definition "A candidiasis that results_in fungal infection of the outer-most layer located_in nail, has_material_basis_in Candida species. The infection causes painful, red, swollen area around the nail, often at the cuticle or at the site of a hangnail or other injury." ;
    :has_exact_synonym "candidiasis of skin"@en,
        "candidiasis of skin and nails"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wagr_syndrome rdfs:subClassOf :chromosomal_deletion_syndrome ;
    :has_definition "A chromosomal deletion syndrome that is a nephroblastoma that results_in a rare genetic syndrome in which affected children are predisposed to develop Wilms tumor, Aniridia (absence of the colored part of the eye, the iris), genitourinary anomalies, and mental retardation. The condition results from a deletion on chromosome 11 resulting in the loss of several genes. As such, it is one of the best studied examples of a condition caused by loss of neighbouring (contiguous) genes." ;
    :has_exact_synonym "11p partial monosomy syndrome"@en,
        "Wilms tumor-Aniridia-Genitourinary Anomalies-Mental Retardation syndrome"@en,
        "chromosome 11p13 deletion syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:partial_arterial_retinal_occlusion rdfs:subClassOf :retinal_artery_occlusion ;
    :has_exact_synonym "Retinal partial arterial occlusion"@en,
        "partial retinal arterial occlusion"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:argyll_robertson_pupil rdfs:subClassOf :abnormal_pupillary_function ;
    :has_definition "An abnormal pupillary function characterized by a small pupil, the absence of a pupillary light reflex and the retention of a normal pupillary near response." ;
    :has_exact_synonym "Argyll Robertson phenomenon or pupil, nonsyphilitic"@en,
        "Argyll Robertson pupil, atypical"@en,
        "Atypical Argyll-Robertson pupil"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:senile_degeneration_of_brain rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :cerebral_degeneration ;
    :has_exact_synonym "Senile brain degen."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:reye_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome characterized by acute brain damage and liver function problems. It has been associated with aspirin consumption by children with viral illness, although it also occurs in the absence of aspirin use." ;
    :has_exact_synonym "Reye's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atrophic_glossitis rdfs:subClassOf :glossitis ;
    :has_exact_synonym "Atrophy of tongue papillae"@en,
        "Glossitis, Hunter's"@en,
        "Hunter's glossitis"@en,
        "smooth atrophic tongue"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_cardiac_peripheral_nerve_sheath_neoplasm rdfs:subClassOf :malignant_peripheral_nerve_sheath_tumor ;
    :has_exact_synonym "MPNST of Heart"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_cardiac_germ_cell_tumor rdfs:subClassOf :heart_cancer ;
    :has_exact_synonym "malignant cardiac germ cell tumour"@en,
        "malignant germ cell tumor of the Heart"@en,
        "malignant germ cell tumour of the Heart"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rete_testis_adenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :rete_testis ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :adenocarcinoma,
        :rete_testis_neoplasm ;
    :has_definition "A rete testis neoplasm that derives_from epithelial cells of glandular origin." ;
    :has_exact_synonym "adenocarcinoma of the rete testis"@en ;
    :has_related_synonym "adenocarcinoma of rete testis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seminal_vesicle_adenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :seminal_vesicle ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :adenocarcinoma,
        :male_reproductive_organ_cancer ;
    :has_definition "A male reproductive organ cancer that derives_from epithelial cells of glandular origin." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sphenoidal_sinus_cancer rdfs:subClassOf :paranasal_sinus_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :sphenoidal_sinus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant tumor of Sphenoidal sinus"@en,
        "malignant tumor of sphenoid sinus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sphenoid_sinus_squamous_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :squamous_epithelial_cell ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :sphenoidal_sinus ],
        :sphenoidal_sinus_cancer,
        :squamous_cell_carcinoma ;
    :has_definition "A squamous cell carcinoma that is located_in the sphenoid sinus." ;
    :has_exact_synonym "Epidermoid carcinoma of the Sphenoidal sinus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:steroid_induced_glaucoma_borderline rdfs:subClassOf :borderline_glaucoma ;
    :has_exact_synonym "Borderline glaucoma steroid responder"@en,
        "Steroid responders borderline glaucoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geographic_tongue rdfs:subClassOf :atrophic_glossitis ;
    :has_definition "An atrophic glossitis that is characterized as an inflammatory condition of the mucous membrane of the tongue, usually on the dorsal surface." ;
    :has_exact_synonym "Glossitis areata exfoliativa"@en,
        "Pityriasis linguae"@en,
        "benign migratory glossitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_pulmonary_hypertension rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :syncope ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dizziness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :leg_swelling ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :digenic_inheritance ],
        :chronic_pulmonary_heart_disease,
        :digenic_disease ;
    :has_definition "A chronic pulmonary heart disease characterized by an increase of blood pressure in the pulmonary artery, pulmonary vein, or pulmonary capillaries, among others, has symptoms shortness of breath, dizziness, fainting, leg swelling." ;
    :has_exact_synonym "Idiopathic pulmonary arterial hypertension" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:disease_of_cellular_proliferation rdfs:subClassOf :disease ;
    :has_definition "A disease that is characterized by abnormally rapid cell division." ;
    :has_exact_synonym "cell process disease"@en,
        "neoplasm"@en ;
    :obi_9991118 "neoplasm" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:postsurgical_hypothyroidism rdfs:subClassOf :hypothyroidism ;
    :has_exact_synonym "Post-surgical hypothyroidism"@en,
        "Postoperative hypothyroidism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypothyroidism rdfs:subClassOf :thyroid_gland_disease ;
    :has_definition "A thyroid gland disease which involves an underproduction of thyroid hormone." ;
    :has_exact_synonym "Thyroid deficiency"@en,
        "Thyroid insufficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atheroembolism_of_kidney rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :kidney ],
        :cholesterol_embolism,
        :kidney_disease .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cholesterol_embolism rdfs:subClassOf :vascular_disease ;
    :has_definition "A vascular disease that is characterized by blood vessel obstruction resulting from the release of cholesterol from the inside of blood vessels along the bloodstream." ;
    :has_exact_synonym "atheroembolism"@en,
        "cholesterol crystal embolism"@en,
        "purple toe syndrome"@en,
        "trash foot"@en,
        "warfarin blue toe syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acrodysostosis rdfs:subClassOf :dysostosis ;
    :has_definition "A dysostosis that results_in shortening of interphalangeal joints located_in hand or located_in foot along with mental deficiency." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:serous_labyrinthitis rdfs:subClassOf :labyrinthitis ;
    :has_definition "A labyrinthitits in which bacterial toxins invade the inner ear. It is the most common complication of acute or chronic middle ear infections." ;
    :has_exact_synonym "acute serous labyrinthitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypertelorism_microtia_facial_clefting_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by the combination of hypertelorism, cleft lip and palate and microtia." ;
    :has_exact_synonym "Bixler Christian Gorlin syndrome"@en,
        "Bixler syndrome"@en,
        "Bixler-Christian-Gorlin syndrome"@en,
        "HMC syndrome"@en,
        "Hypertelorism-Microtia-Clefting Syndrome"@en,
        "Hypertelorism-microtia-facial clefting syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_intestinal_atresia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :intestinal_disease ;
    :has_definition "An intestinal disease characterized by the presence of numerous atresic segments in the small and large intestines that has_material_basis_in homozygous or compound heterozygous mutation in the TTC7A gene on chromosome 2p21." ;
    :has_exact_synonym "GIDID"@en,
        "Multiple gastrointestinal atresias"@en,
        "familial intestinal polyatresia syndrome"@en,
        "gastrointestinal defects and immunodeficiency syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vacterl_association rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by the presence of at least three of the following: vertebral defects, anal atresia, cardiac defects, tracheo-esophageal fistula, renal anomalies, and limb abnormalities." ;
    :has_related_synonym "VATER syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:labyrinthitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :otitis_interna ;
    :has_definition "An otitis interna which involves inflammation of the labyrinths." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:silver_russell_syndrome rdfs:subClassOf :physical_disorder ;
    :has_definition "A physical disorder that is characterized by severe intrauterine growth retardation, poor postnatal growth, craniofacial features such as a triangular shaped face and a broad forehead, body asymmetry, and a variety of minor malformations." ;
    :has_exact_synonym "Silver Russell Dwarfism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:binder_syndrome rdfs:subClassOf :nasal_cavity_disease ;
    :has_exact_synonym "binder type maxillonasal dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:axenfeld_rieger_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        :autosomal_dominant_disease,
        :eye_disease ;
    :has_definition "An eye disease characterized by abnormalities of the front part of the eye, the anterior segment." ;
    :has_exact_synonym "Anomaly, Rieger's"@en,
        "Axenfeld syndrome"@en,
        "RGS - Rieger syndrome"@en,
        "Rieger's anomaly"@en ;
    :has_related_synonym "Hagedoom syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diastrophic_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that has_material_basis_in abnormal cartilage development due to mutations in the SLC26A2 gene which results_in short limb dwarfism." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smith_lemli_opitz_syndrome rdfs:subClassOf :lipid_metabolism_disorder ;
    :has_exact_synonym "Rutledge lethal multiple congenital anomaly syndrome"@en,
        "Smith-Opitz-Inborn syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clouston_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ectodermal_dysplasia ;
    :has_definition "An ectodermal dysplasia that is characterized by abnormalities of the hair, nails, and skin, with the teeth and sweat glands being unaffected and that has_material_basis_in heterozygous mutation in the GJB6 gene, which encodes connexin-30, on chromosome 13q12." ;
    :has_exact_synonym "Clouston's hidrotic ectodermal dysplasia"@en,
        "Clouston's syndrome"@en,
        "Hidrotic ectodermal dysplasia syndrome"@en,
        "ectodermal dysplasia 2, Clouston type"@en,
        "hidrotic ectodermal dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:johanson_blizzard_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that involves abnormal development of the pancreas, nose and scalp, with mental retardation, hearing loss and growth failure. It is inherited in an autosomal recessive manner." ;
    :has_exact_synonym "JBS"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:galactokinase_deficiency rdfs:subClassOf :galactosemia ;
    :has_definition "A galactosemia that involves an accumulation of galactose and galactitol secondary to the decreased conversion of galactose to galactose-1-phosphate by galactokinase." ;
    :has_exact_synonym "Galactosemia II"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thrombocytopenia_absent_radius_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :symptom ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :chromosomal_deletion_syndrome,
        :syndrome ;
    :has_definition "A chromosomal deletion syndrome that is characterized by absence of the radius bone and platelet deficiency and bilateral absence of the radii with the presence of both thumbs and generally transient thrombocytopenia (less than 50 platelets/nL) and that has_material_basis_in compound heterozygosity for a rare null mutation involving the RBM8A gene on chromosome 1q12 on 1 allele and 1 of 2 low-frequency noncoding single-nucleotide polymorphisms in RBM8A on the other." ;
    :has_exact_synonym "Radial aplasia-thrombocytopenia syndrome"@en,
        "Thrombocytopenia with absent radii (TAR) syndrome"@en,
        "chromosome 1q21.1 deletion syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:major_depressive_disorder rdfs:subClassOf :depressive_disorder ;
    :has_definition "A depressive disorder that is characterized by at least two weeks of loss of interest or pleasure in normally enjoyable activities or depressed mood along with additional cognitive or somatic impairments such as appetite or weight changes, sleep difficulties, psychomotor agitation or retardation, fatigue or loss of energy, diminished ability to think or concentrate, feelings of worthlessness or excessive guilt, and suicidality." ;
    :has_exact_synonym "clinical depression"@en,
        "major depression"@en,
        "recurrent major depression"@en,
        "single major depressive episode"@en,
        "unipolar depression"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:propionic_acidemia rdfs:subClassOf :organic_acidemia ;
    :has_definition "An organic acidemia that involes a nonfunctional propionyl CoA carboxylase affecting conversion of amino acids and fats into sugar for energy." ;
    :has_exact_synonym "GLYCINEMIA, KETOTIC"@en,
        "KETOTIC HYPERGLYCINEMIA"@en,
        "ketotic II glycinemia"@en,
        "ketotic glycinemia"@en,
        "propionic aciduria"@en,
        "propionyl-CoA carboxylase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:branchiootorenal_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by branchial arch anomalies (branchial fistulas, clefts, or cysts), hearing impairment, structural defects of the outer, middle, and inner ear, and renal abnormalities." ;
    :has_exact_synonym "Branchio-Oto-renal syndrome"@en,
        "Branchio-otorenal dysplasia"@en,
        "Melnick-Fraser syndrome"@en,
        "branchiootorenal dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pfeiffer_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :acrocephalosyndactylia,
        :autosomal_dominant_disease ;
    :has_definition "An acrocephalosyndactylia that has_material_basis_in mutations in the FGFR1 and FGFR2 gene which results_in premature fusion located_in skull." ;
    :has_exact_synonym "acrocephalosyndactylia type V"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fg_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndrome,
        :x_linked_recessive_disease ;
    :has_definition "A syndrome characterized by retardation, hyperactivity, hypotonia, broad thumbs, big first toes and a characteristic facial appearance including macrocephaly and has an X-linked recessive inheritance pattern." ;
    :has_exact_synonym "Keller syndrome"@en,
        "Opitz-Kaveggia syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:centronuclear_myopathy rdfs:subClassOf :congenital_structural_myopathy ;
    :has_definition "A congenital structural myopathy characterized by abnormally located nuclei in skeletal muscle cells. The nuclei are located in the center of the cell, instead of their normal location at the periphery." ;
    :has_exact_synonym "myotubular myopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_classic_type_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by loose-jointedness and fragile, bruisable skin that heals with peculiar 'cigarette-paper' scars and that has_material_basis_in heterozygous mutation in the collagen alpha-1(V) gene (COL5A1) on chromosome 9q34." ;
    :has_exact_synonym "type I Ehlers-Danlos syndrome",
        "Ehlers-Danlos syndrome, type 1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beta_ketothiolase_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lethargy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :seizure ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dehydration ],
        :amino_acid_metabolic_disorder,
        :autosomal_recessive_disease ;
    :has_definition "An amino acid metabolic disorder characterized by inability to process isoleucine and ketones, has_symptom recurrent ketoacidotic attacks in infancy marked by vomitting, lethargy, dehydration, and seizures, and has_material_basis_in mutation in the ACAT1 gene of chromosome 11q22.3 responsible for producing the ACAT1 enzyme in mitochondria, which processes isoleucine and ketones." ;
    :has_exact_synonym "2-methyl-3-hydroxybutyricacidemia"@en,
        "3-ketothiolase deficiency"@en,
        "3-oxothiolase deficiency"@en,
        "Mitochondrial acetoacetyl-CoA Thiolase deficiency"@en,
        "alpha-methylacetoaceticaciduria"@en,
        "peroxisomal thiolase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_microcephaly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :microcephaly ;
    :has_definition "A microcephaly that has_material_basis_in heterozygous mutation in an autosomal gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:weaver_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by prenatal and postnatal overgrowth, accelerated osseous maturation, characteristic craniofacial appearance, and developmental delay and has_material_basis_in heterozygous mutation in the EZH2 gene on chromosome 7q36." ;
    :has_exact_synonym "WEAVER-LIKE SYNDROME"@en,
        "Weaver-Williams syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_angioedema rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :angioedema,
        :autosomal_dominant_disease ;
    :has_definition "An angioedema that is characterized by recurrent episodes of severe swelling of the skin and mucous membranes." ;
    :has_exact_match "MESH:D054179",
        "OMIM:PS106100",
        "ORDO:91378" ;
    :has_exact_synonym "HANE"@en,
        "Hereditary angioneurotic edema"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:craniofrontonasal_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_dominant_inheritance ],
        :syndrome,
        :x_linked_dominant_disease ;
    :has_definition "A syndrome that has_material_basis_in mutation in the EFNB1 gene on chromosome Xq13 and is characterized in hemizygous males by hypertelorism and with greater severity in females by frontonasal dysplasia, craniofacial asymmetry, craniosynostosis, bifid nasal tip, grooved nails, wiry hair, and abnormalities of the thoracic skeleton." ;
    :has_exact_synonym "CFND"@en,
        "CFNS"@en,
        "craniofrontonasal dysostosis"@en,
        "craniofrontonasal dysplasia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aggressive_periodontitis rdfs:subClassOf :periodontitis ;
    :has_definition "A periodontitis that is characterized by rapid attachment loss and bone destruction in the presence of little local factors such as dental plaque and dental calculus resulting in inflammation and a loss of periodontium." ;
    :has_exact_match "MESH:D010520" ;
    :has_exact_synonym "juvenile periodontitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trichorhinophalangeal_syndrome_type_i rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by short stature, sparse hair, a bulbous nasal tip and cone-shaped epiphyses (the growing ends of bones), as well as severe generalized shortening of all finger and toe bones (brachydactyly)." ;
    :has_exact_synonym "trichorhinophalangeal syndrome type 1"@en,
        "type I trichorhinophalangeal syndrome"@en ;
    :has_related_synonym "Trichorhinophalangeal dysplasia type I"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:partington_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndromic_x_linked_intellectual_disability,
        :x_linked_recessive_disease ;
    :has_definition "A syndrome characterized by intellectual disability, focal dystonia of the hands and dysarthria." ;
    :has_exact_synonym "X-linked Russell-Silver syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sotos_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :syndrome ;
    :has_definition "A syndrome that occurs rarely and is characterized by excessive physical growth during the first 2 to 3 years of life." ;
    :has_exact_synonym "cerebral gigantism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methylmalonic_acidemia rdfs:subClassOf :organic_acidemia ;
    :has_definition "An organic acidemia that involves an accumulation of methylmalonic acid in the blood." ;
    :has_exact_synonym "methylmalonic aciduria"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lymphangioma rdfs:subClassOf :benign_vascular_tumor ;
    :has_definition "A benign vascular tumor that is composed of dilated lymphatic channels." ;
    :has_exact_synonym "Congenital lymphangioma"@en,
        "benign lymphangioma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:isovaleric_acidemia rdfs:subClassOf :organic_acidemia ;
    :has_definition "An organic acidemia that disrupts or prevents normal metabolism of the branched-chain amino acid leucine." ;
    :has_exact_synonym "Isovaleryl-CoA dehydrogenase deficiency"@en,
        "isovaleric acid CoA dehydrogenase deficiency"@en,
        "isovaleric aciduria"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:argininosuccinic_aciduria rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves the accumulation of argininosuccinic acid (ASA) in the blood and urine." ;
    :has_exact_synonym "Argininosuccinate lyase deficiency"@en,
        "argininosuccinic acidemia"@en,
        "arginosuccinase deficiency"@en,
        "deficiency of argininosuccinate lyase"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vascular_type_ehlers_danlos_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that has_material_basis_in heterozygous mutation in the COL3A1 gene on chromosome 2q32 and that is characterized by the association of unexpected organ fragility (arterial/bowel/gravid uterine rupture) with inconstant physical features as thin, translucent skin, easy bruising and acrogeric traits." ;
    :has_exact_synonym "autosomal dominant type IV Ehlers-Danlos syndrome" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ehlers_danlos_syndrome_hypermobility_type rdfs:subClassOf :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by joint hyperextensibility without skeletal deformity." ;
    :has_exact_synonym "type III Ehlers-Danlos syndrome",
        "Ehlers-Danlos syndrome, type 3"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_type_iv_ehlers_danlos_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by the association of unexpected organ fragility (arterial/bowel/gravid uterine rupture) with inconstant physical features as thin, translucent skin, easy bruising and acrogeric traits." ;
    :has_exact_synonym "Ehlers-Danlos syndrome, recessive type 4"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:greig_cephalopolysyndactyly_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :acrocephalosyndactylia,
        :autosomal_dominant_disease ;
    :has_definition "An acrocephalosyndactylia that has_material_basis_in mutation in the GLI3 gene which results_in abnormal development located_in limb, located_in head, located_in face." ;
    :has_exact_synonym "polysyndactyly with peculiars skull shape"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:calcaneonavicular_coalition rdfs:subClassOf :synostosis ;
    :has_definition "A synostosis characterized by the fusion of carpal and tarsal bones, which causes stiffness and immobility of the hands and the feet." ;
    :has_exact_synonym "Multiple synostosis syndrome"@en,
        "SYNOSTOSES, TARSAL, CARPAL AND DIGITAL"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:larsen_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by autosomal dominant inheritance of large-joint dislocations and characteristic craniofacial abnormalities." ;
    :has_exact_synonym "dominant larsen syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_agenesis rdfs:subClassOf :kidney_disease ;
    :has_definition "A renal disease that is characterized by the failure of one or both kidneys to develop." ;
    :has_exact_synonym "hereditary renal aplasia"@en,
        "hereditary urogenital adysplasia"@en,
        "renal adysplasia"@en,
        "renal aplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:saethre_chotzen_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :acrocephalosyndactylia,
        :autosomal_dominant_disease ;
    :has_definition "An acrocephalosyndactylia that has_material_basis_in a genetic mutation in the TWIST1 gene which results_in premature fusion located_in skull." ;
    :has_related_synonym "acrocephalosyndactyly type III"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cartilage_hair_hypoplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :ectodermal_dysplasia ;
    :has_definition "An ectodermal dysplasia characterized by short-limbed short stature and fine, sparse hair that has_material_basis_in homozygous or compound heterozygous mutation in the RMRP gene on chromosome 9p13.3." ;
    :has_exact_synonym "CHH"@en,
        "McKusick type metaphyseal chondrodysplasia"@en,
        "Metaphyseal chondrodysplasia, McKusick type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brittle_cornea_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cornea ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :corneal_disease,
        :ehlers_danlos_syndrome ;
    :has_definition "An Ehlers-Danlos syndrome that is characterized by blue sclerae, corneal rupture after minor trauma, keratoconus or keratoglobus, hyperelasticity of the skin, and hypermobility of the joints and has_material_basis_in homozygous mutation in the ZNF469 gene on chromosome 16q24." ;
    :has_exact_synonym "type VIB Ehlers-Danlos syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_familial_neonatal_epilepsy rdfs:subClassOf :neonatal_period_electroclinical_syndrome ;
    :has_exact_synonym "familial neonatal seizures"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blepharophimosis_ptosis_and_epicanthus_inversus_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by blepharophimosis, ptosis, epicanthus inversus, and telecanthus with (type I) or without (premature ovarian failure) that has_material_basis_in heterozygous or rarely homozygous mutation in the FOXL2 gene on chromosome 3q22.3." ;
    :has_related_synonym "Blepharophimosis, ptosis, epicanthus inversus syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kbg_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :limb ],
        :spinal_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by short stature, moderate to severe degrees of mental retardation, developmental abnormalities of the limbs, bones of the spine (vertebrae), extremities, and/or underdevelopment of the bones of the skeleton." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:olivopontocerebellar_atrophy rdfs:subClassOf :neurodegenerative_disease ;
    :has_definition "A neurodegenerative disease that is characterized by progressive cerebellar ataxia, leading to clumsiness in body movements, veering from midline when walking, wide-based stance, and falls without signs of paralysis or weakness and has_material_basis_in expansion of CAG triplet repeats (glutamine) resulting in degeneration of neuron in the cerebellum, pons and inferior olives." ;
    :has_exact_synonym "Dejerine-Thomas syndrome"@en,
        "Thomas' syndrome"@en,
        "WADIA-SWAMI SYNDROME"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spondyloepiphyseal_dysplasia_congenita rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :spondyloepiphyseal_dysplasia ;
    :has_definition "A spondyloepiphyseal dysplasia characterized by disproportionate short stature (short trunk), abnormal epiphyses, and flattened vertebral bodies that has_material_basis_in heterozygous mutation in the COL2A1 gene on chromosome 12q13.11." ;
    :has_exact_synonym "Late Spondyloepiphyseal Dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leber_congenital_amaurosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :physical_disorder,
        :retinal_disease ;
    :has_definition "A retinal disease that is characterized by nystagmus, sluggish or no pupillary responses, and severe vision loss or blindness." ;
    :has_exact_synonym "LCA"@en,
        "Leber's amaurosis"@en,
        "Leber's congenital amaurosis"@en,
        "Leber's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypohidrotic_ectodermal_dysplasia rdfs:subClassOf :ectodermal_dysplasia ;
    :has_definition "An ectodermal dysplasia that is characterized by malformation of ectodermal (skin, hair, teeth and sweat glands) structures including hypotrichosis (sparseness of scalp and body hair), hypohidrosis (reduced ability to sweat), and hypodontia (congenital absence of teeth)." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dubowitz_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :retrognathia ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :growth_delay ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ptosis ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by microcephaly, growth retardation and a characteristic facial appearance including but not limited to narrow or triangular shaped head, micrognathia, ptosis, a broad, wide-tipped nose, and wide-set eyes with drooping eyelids." ;
    :has_exact_synonym "Dubowitz's syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blount_s_disease rdfs:subClassOf :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that results_in inward turning of lower leg, located_in tibia, which fails to develop normally." ;
    :has_exact_synonym "Blount disease"@en,
        "familial infantile type osteochondrosis deformans tibiae"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gingival_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :gingiva ],
        :periodontal_disease ;
    :has_definition "A periodontal disease that is located_in the gums." ;
    :has_exact_synonym "gum disease" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:cystic_fibrosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onClass [ owl:intersectionOf [ rdf:first :loss_of_function_variant ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onClass :gene ;
                                            owl:onProperty :disease_has_location ;
                                            owl:qualifiedCardinality "1"^^xsd:nonNegativeInteger ] ;
                                    rdf:rest :nil ] ] ] ;
            owl:onProperty :has_material_basis_in ;
            owl:qualifiedCardinality "1"^^xsd:nonNegativeInteger ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by the buildup of thick, sticky mucus that can damage many organs." ;
    :has_exact_match "MESH:D003550" ;
    :has_exact_synonym "CF"@en,
        "mucoviscidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cystic_echinococcosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :urticaria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :shock ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anaphylactic_shock ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemoptysis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_mass ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :heart ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :brain ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :bone_element ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :disease_has_location ;
                                                    owl:someValuesFrom :lung ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :disease_has_location ;
                                                            owl:someValuesFrom :liver ] ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        :bone_disease,
        :brain_disease,
        :echinococcosis,
        :heart_disease,
        :liver_disease,
        :lung_disease ;
    :has_definition "An echinococcosis that is caused by the larvae of Echinococcus granulosus. Hepatic involvement can result in abdominal pain, a mass in the hepatic area, and biliary duct obstruction. Pulmonary involvement can produce chest pain, cough, and hemoptysis. Rupture of the cysts produce fever, urticaria, eosinophilia, and anaphylactic shock, as well as cyst dissemination. Brain, bone, heart can also be infected." ;
    :has_exact_synonym "Echinococcus granulosus infection"@en,
        "Echinococcus granulosus infection of lung"@en,
        "Echinococcus granulosus infection of thyroid"@en,
        "Liver echinococcus granulosus"@en,
        "Thyroid echinococcus granulosus"@en,
        "echinococcus granulosus"@en,
        "echinococcus granulosus infectious disease"@en,
        "echinococcus granulosus infectious disease of liver"@en,
        "echinococcus granulosus infectious disease of thyroid"@en,
        "lung echinococcus granulosus"@en,
        "unilocular echinococcosis"@en,
        "unilocular hydatid disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:echinococcosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :echinococcus ],
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of humans and domestic animals caused by the larval stages of tapeworms of the genus Echinococcus in the liver, lungs, spleen, brain, heart and kidneys." ;
    :has_exact_synonym "Echinococcosis of liver"@en,
        "echinococcal disease"@en,
        "hepatic echinococcosis"@en,
        "hydatid disease"@en,
        "hydatidosis"@en,
        "liver echinococcus"@en,
        "pulmonary echinococcosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cholera rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :shock ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vehicle_borne_ingestion_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :vibrio_cholerae ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that is described as an acute, diarrheal illness caused by infection of the intestine with the bacterium Vibrio cholerae, which is characterized by profuse watery diarrhea, vomiting, leg cramps, circulatory collapse and shock." ;
    :has_exact_match "MESH:D002771" ;
    :has_exact_synonym "Cholera - Vibrio cholerae"@en,
        "Cholera due to Vibrio cholerae"@en,
        "Vibrio cholerae"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:reproductive_system_disease rdfs:subClassOf :disease_of_anatomical_entity ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :reproductive_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease of anatomical entity that is located_in reproductive system organs." ;
    :has_exact_synonym "genital system disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:disease_of_mental_health rdfs:subClassOf :disease ;
    :has_definition "A disease that involves a psychological or behavioral pattern generally associated with subjective distress or disability that occurs in an individual, and which are not a part of normal development or culture." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:candidiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :candida ],
        :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that involves fungal infection of the mouth, throat, skin, scalp, vagina, fingers, nails, bronchi, lungs, heart and brain by Candida species, of which Candida albicans is the most common. Systemic Candida infections are usually confined to severely immunocompromised persons." ;
    :has_exact_synonym "Disseminated candidiasis"@en,
        "systemic candidiasis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:avoidant_personality_disorder rdfs:subClassOf :personality_disorder ;
    :has_definition "A personality disorder that is characterized by a pervasive pattern of social inhibition, feelings of inadequacy, extreme sensitivity to negative evaluation, and avoidance of social interaction." ;
    :has_exact_synonym "anxious personality disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:personality_disorder rdfs:subClassOf :disease_of_mental_health ;
    :has_definition "A disease of mental health that involve long-term patterns of thoughts and behaviors that cause serious problems with relationships and work." ;
    :has_exact_synonym "character disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_gonorrhea_of_cervix rdfs:subClassOf :chronic_cervicitis ;
    :has_definition "A chronic cervicitis that is caused by gonorrhea." ;
    :has_exact_synonym "Gonococcal cervicitis, chronic"@en,
        "chronic gonococcal cervicitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_cervicitis rdfs:subClassOf :cervicitis ;
    :has_definition "A cervicitis that is present for weeks or more." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

