                                    owl:someValuesFrom :epithelial_cell ] ;
                            rdf:rest :nil ] ] ],
        :carcinoma,
        :cecum_cancer ;
    :has_definition "A cecum cancer that has_material_basis_in abnormally proliferating cells derives_from epithelial cells." ;
    :has_exact_synonym "Caecum carcinoma"@en,
        "Cecal cancer"@en,
        "carcinoma of cecum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colon_carcinoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :epithelial_cell ] ;
                            rdf:rest :nil ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :colon ],
        :carcinoma,
        :colon_cancer ;
    :has_definition "A colon cancer that has_material_basis_in abnormally proliferating cells derives_from epithelial cells." ;
    :has_exact_synonym "Colonic carcinoma"@en,
        "carcinoma of colon"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

