                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :caecum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A large intestine cancer that is located_in the cecum." ;
    :has_exact_synonym "malignant neoplasm of caecum"@en,
        "malignant tumor of the cecum"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cecum_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :cecum_cancer,
        :lymphoma ;
    :has_exact_synonym "Cecal Lymphoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colon_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :lymphocyte ],
        :colon_cancer,
        :lymphoma ;
    :has_exact_synonym "Colonic Lymphoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

