    :has_exact_synonym "Relapsing febrile nodular nonsuppurative panniculitis"@en,
        "Weber - Christian disease"@en,
        "Weber-Christian disease"@en,
        "nodular non-suppurative febrile panniculitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:panniculitis rdfs:subClassOf :skin_disease ;
    :has_definition "A skin disease that is characterized by inflammation of subcutaneous adipose tissue." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

