    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :penis ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleural_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :heart_failure ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :lower_respiratory_tract_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :pleura ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A thoracic disease which may involve inflammation of pleura, collection of air within the pleural cavity, abnormal collection of pleural fluid, abnormal growths on the pleura (pleural tumor) and pleural plaques. The main causes of pleural diseases including pleural effusions are congestive heart failure, malignancy, parapneumonic infections and pulmonary embolism." ;
    :has_exact_synonym "disorder of pleura"@en,
        "non-neoplastic pleural disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_cell_type_cancer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first [ owl:intersectionOf [ rdf:first :ectoderm ;
                                            rdf:rest [ rdf:first :endoderm ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :ectoderm ;
                                                    rdf:rest [ rdf:first :endoderm ;
                                                            rdf:rest [ rdf:first :mesoderm ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :ectoderm ;
                                                            rdf:rest [ rdf:first :mesoderm ;
                                                                    rdf:rest :nil ] ] ] ;
                                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :endoderm ;
                                                                    rdf:rest [ rdf:first :mesoderm ;
                                                                            rdf:rest :nil ] ] ] ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        :cell_type_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ owl:unionOf [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :derives_from ;
                                                                    owl:someValuesFrom :ectodermal_cell ] ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :derives_from ;
                                                                            owl:someValuesFrom :mesodermal_cell ] ;
                                                                    rdf:rest :nil ] ] ] ;
                                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :derives_from ;
                                                                            owl:someValuesFrom :ectodermal_cell ] ;
                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                    owl:onProperty :derives_from ;
                                                                                    owl:someValuesFrom :endodermal_cell ] ;
                                                                            rdf:rest :nil ] ] ] ;
                                                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                                                                                    owl:onProperty :derives_from ;
                                                                                    owl:someValuesFrom :mesodermal_cell ] ;
                                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                            owl:onProperty :derives_from ;
                                                                                            owl:someValuesFrom :endodermal_cell ] ;
                                                                                    rdf:rest :nil ] ] ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cell type cancer that has_material_basis_in abnormally proliferating cells derives_from two germinal layers of tissue." ;
    :has_exact_synonym "malignant mixed cancer"@en,
        "malignant mixed neoplasm"@en,
        "mixed tumor"@en,
        "mixed tumor, malignant"@en ;
    :has_related_synonym "malignant mixed tumor"@en,
        "mixed neoplasm"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parathyroid_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :parathyroid_gland ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :carcinoma,
        :endocrine_gland_cancer,
        :parathyroid_gland_disease ;
    :has_definition "An endocrine gland cancer located_in the parathyroid glands located in the neck." ;
    :has_exact_synonym "Parathyroid gland neoplasm"@en,
        "carcinoma of Parathyroid gland"@en,
        "malignant neoplasm of parathyroid gland"@en,
        "malignant neoplasm of the Parathyroid"@en,
        "malignant tumor of parathyroid gland"@en,
        "neoplasm of parathyroid gland"@en,
        "parathyroid gland cancer"@en,
        "parathyroid neoplasm"@en ;
    :has_related_synonym "parathyroid gland adenocarcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:head_and_neck_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :carcinoma,
        :head_and_neck_cancer ;
    :has_definition "A head and neck cancer that has_material_basis_in epithelial cells and is located in the upper aerodigestive tract, including the lip, oral cavity (mouth), nasal cavity, paranasal sinuses, pharynx, and larynx." ;
    :has_exact_synonym "carcinoma of the neck"@en ;
    :has_related_synonym "carcinoma of neck"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vibratory_urticaria rdfs:subClassOf :physical_urticaria ;
    :has_definition "A physical urticaria that is characterized by itching, reddish skin and swelling within minutes of local exposure to dermal vibration and that has_material_basis_in heterozygous mutation in the ADGRE2 gene on chromosome 19p13." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urticaria rdfs:subClassOf :skin_disease ;
    :has_definition "A skin disease characterized by skin rash notable for pale red, raised and itchy bumps, located_in the upper dermis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthus_reaction rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemorrhage ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :edema ],
        :hypersensitivity_reaction_type_iii_disease ;
    :has_definition "A hypersensitivity reaction type III disease that is characterized by local vasculitis, has_symptom pain, edema, hemorrhage, or necrosis, and has_material_basis_in deposition of antigen-antibody immune complexes in vascular or serosal walls." ;
    :has_exact_synonym "Arthus phenomenon"@en,
        "Arthus type urticaria"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypersensitivity_reaction_type_iii_disease rdfs:subClassOf :hypersensitivity_reaction_disease ;
    :has_definition "A hypersensitivity reaction disease that is characterized by the accumulation of antigen-antibody immune complexes, causing an inflammatory response and injury." ;
    :has_exact_synonym "immune complex disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:angioedema rdfs:subClassOf :skin_disease ;
    :has_definition "A skin disease characterized by one or more areas of well-demarcated, non-pitting edema of deep subcutaneous tissues." ;
    :has_exact_synonym "Angioneurotic oedema"@en,
        "Quincke's edema"@en,
        "angioneurotic edema"@en,
        "giant urticaria"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cognitive_disorder rdfs:subClassOf :disease_of_mental_health ;
    :has_definition "A disease of mental health that affects cognitive functions including memory processing, perception and problem solving." ;
    :has_exact_synonym "cognitive disease"@en ;
    :has_related_synonym "Organic Mental disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chromoblastomycosis rdfs:subClassOf :subcutaneous_mycosis ;
    :has_definition "A subcutaneous mycosis that is a chronic subcutaneous fungal infection, which presents as nodular or verrucoid, ulcerated, or crusted skin lesions on exposed areas of skin caused by Fonsecaea pedrosoi, Fonsecaea compacta, Cladophialophora carrionii or Phialophora verrucosa. Histological examination reveals muriform cells (with perpendicular septations) or thick walled, dark-colored, rounded forms (copper pennies) that are characteristic of this infection." ;
    :has_exact_synonym "Chromomycosis"@en,
        "Mossy foot disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dermatomycosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :ascomycota ],
        :cutaneous_mycosis,
        :skin_disease ;
    :has_definition "A cutaneous mycosis that results in fungal infection located in skin or of its appendages, has_material_basis_in Ascomycota fungi other than the dermatophytes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fungal_infectious_disease rdfs:subClassOf :disease_by_infectious_agent ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :fungi ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease by infectious agent that results_in infection, has_material_basis_in Fungi, which pass the resistance barriers of the human or animal body." ;
    :has_exact_synonym "mycosis"@en ;
    :has_related_synonym "mycoses"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ectropion rdfs:subClassOf :eyelid_disease ;
    :has_exact_synonym "Ectropion of eyelid"@en,
        "Everted margin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:normal_pressure_hydrocephalus rdfs:subClassOf :communicating_hydrocephalus ;
    :has_exact_synonym "Low pressure hydrocephalus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcohol_use_disorder rdfs:subClassOf :substance_abuse ;
    :has_definition "A substance abuse that involves the recurring use of alcoholic beverages despite negative consequences." ;
    :has_exact_synonym "Ethanol abuse"@en,
        "alcohol abuse"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rheumatic_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :connective_tissue ],
        :connective_tissue_disease ;
    :has_definition "A musculoskeletal system disease that involves inflammation or pain in the muscles, joints, or fibrous tissue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:limited_scleroderma rdfs:subClassOf :systemic_scleroderma ;
    :has_exact_synonym "Limited cutaneous systemic sclerosis"@en,
        "systemic sclerosis, limited"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

