            owl:someValuesFrom :choreatic_disease ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :streptococcus_pyogenes ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :bacterial_infectious_disease ;
    :has_definition "A connective tissue disease that develops from an antecedent Group A Streptococcal pharyngeal infection and has_symptom carditis, has_symptom polyarthritis, has_symptom chorea, has_symptom erythema marginatum, has_symptom subcutaneous nodules, has_symptom arthralgia, has_symptom prolonged PR interval, and/or has_symptom fever." ;
    :has_exact_match "MESH:D012213" ;
    :has_exact_synonym "ACUTE RHEUMATIC FEVER"@en,
        "RhF - Rheumatic fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thrombocytopenia_due_to_platelet_alloimmunization rdfs:subClassOf :thrombocytopenia ;
    :has_exact_synonym "Auto-immune thrombocytopenia"@en,
        "Immune thrombocytopenia"@en,
        "Thrombocytopenia Due to Immune Destruction"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thrombocytopenia rdfs:subClassOf :blood_platelet_disease ;
