    :has_exact_match "MESH:D003866",
        "NCI:C2982",
        "SNOMEDCT_US_2023_02_28:35489007" ;
    :has_exact_synonym "mental depression" ;
    :has_related_synonym "depression" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:integumentary_system_disease rdfs:subClassOf :disease_of_anatomical_entity ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
