    :has_definition "A lymph node disease that is characterized by an acute or chronic inflammation of one or more lymph nodes." ;
    :has_exact_synonym "Adenitis"@en,
        "Inflammation of lymph node"@en,
        "acute adenitis"@en,
        "acute lymphadenitis"@en,
        "chronic Lymphadenitis"@en,
        "chronic adenitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypoglycemic_coma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :seizure ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :coma ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :cognitive_impairment ],
        :brain_disease ;
