                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :male_breast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A breast cancer that occurs in males." ;
    :has_exact_synonym "malignant neoplasm of male breast"@en,
