    :has_exact_synonym "malignant neoplasm"@en,
        "malignant tumor"@en,
        "primary cancer"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_leiomyoma rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that has_material_basis_in smooth muscle cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_adenoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :epithelial_cell ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_origin ;
                                    owl:someValuesFrom :gland ] ;
                            rdf:rest :nil ] ] ],
        :adenoma,
        :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that is has_material_basis_in epithelial tissue in which tumor cells form glands or glandlike structures." ;
    :has_exact_synonym "Ademoma - breast"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_duct_papilloma rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :epithelial_cell ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :mucosa ] ;
                            rdf:rest :nil ] ] ],
        :intraductal_papillary_breast_neoplasm,
        :papilloma ;
    :has_definition "An intraductal papillary breast neoplasm that is has_material_basis_in epithelial tissue on papillae of vascularized connective tissue." ;
    :has_exact_synonym "duct papilloma of breast"@en,
        "papilloma of the breast"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intraductal_papilloma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :mucosa ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :epithelial_cell ],
        :intraductal_breast_benign_neoplasm,
        :papilloma ;
    :has_exact_synonym "ductal papilloma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intraductal_papillary_breast_neoplasm rdfs:subClassOf :intraductal_breast_benign_neoplasm ;
    :has_definition "An intraductal breast benign neoplasm that is characterized by fingerlike growth projections." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_myofibroblastoma rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that derives_from precursor mesenchymal cells with myofibroblastic differentiation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_breast_phyllodes_tumor rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that has_material_basis_in epithelial and stromal tissue and derives_from periductal stromal cells of the breast." ;
    :has_exact_synonym "Cystosarcoma phyllodes"@en,
        "Phyllodes neoplasm"@en,
        "benign Phyllodes neoplasm"@en,
        "benign Phyllodes neoplasm of the breast"@en,
        "benign cystosarcoma phyllodes"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_angiomatosis rdfs:subClassOf :breast_disease,
        :capillary_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :capillary_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :breast ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A breast disease that is characterized by diffuse vascularity surrounding ducts and lobules without invasion, large irregular vascular spaces and flat epithelium without atypia." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :central_nervous_system ],
        :central_nervous_system_disease,
        :extrapulmonary_tuberculosis ;
    :has_definition "An extrapulmonary tuberculosis that results in formation of tuberculomas located_in brain or located_in spinal cord." ;
    :has_exact_synonym "intracranial tuberculoma"@en,
        "tuberculoma of brain"@en,
        "tuberculosis of meninges and central nervous system"@en,
        "tuberculous abscess of brain"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skeletal_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :bone_element ],
        :bone_disease,
        :extrapulmonary_tuberculosis ;
    :has_definition "An extrapulmonary tuberculosis that results in formation of lesions located in bone." ;
    :has_exact_synonym "osteoarticular tuberculosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:benign_breast_adenomyoepithelioma rdfs:subClassOf :breast_benign_neoplasm ;
    :has_definition "A breast benign neoplasm that is characterized by dual differentiation into luminal cells and myoepithelial cells." ;
    :has_exact_synonym "benign Adenomyoepithelioma of the breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_adenomyoepithelioma rdfs:subClassOf :breast_myoepithelial_neoplasm ;
    :has_definition "A breast myoepithelial neoplasm that affects the breast and is characterized by biphasic proliferation of both epithelial and myoepithelial cells." ;
    :has_exact_synonym "breast Adenomyoepithelioma with malignant Change"@en,
        "malignant adenomyoepithelioma of breast"@en ;
    :has_related_synonym "adenomyoepithelioma of the breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:female_breast_upper_inner_quadrant_cancer rdfs:subClassOf :female_breast_cancer ;
    :has_definition "A female breast cancer that is located_in the upper-inner quadrant of the breast." ;
    :has_exact_synonym "malignant neoplasm of upper-inner quadrant of female breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:female_breast_lower_inner_quadrant_cancer rdfs:subClassOf :female_breast_cancer ;
    :has_definition "A female breast cancer that is located_in the lower-inner quadrant of the breast." ;
    :has_exact_synonym "malignant neoplasm of lower-inner quadrant of female breast"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:female_breast_axillary_tail_cancer rdfs:subClassOf :female_breast_cancer ;
    :has_definition "A female breast cancer that is located_in the breast tissue extending into the axilla." ;
    :has_exact_synonym "malignant neoplasm of axillary tail of female breast"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ventricular_septal_defect rdfs:subClassOf :heart_septal_defect ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :heart_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :interventricular_septum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A heart septal defect characterized by an opening in the interventricular septum, causing a shunt between ventricles." ;
    :has_exact_synonym "Interventricular septal defect"@en,
        "Ventricular septal abnormality"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:supratentorial_cancer rdfs:subClassOf :brain_cancer ;
    :has_definition "A brain cancer that is located in the supratentorial region." ;
    :has_exact_synonym "Brain neoplasm, Supratentorial"@en,
        "malignant Supratentorial tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_pineal_area_germ_cell_neoplasm rdfs:subClassOf :pineal_gland_cancer ;
    :has_exact_synonym "Pineal Region germ cell tumor"@en,
        "malignant Pineal Parenchymal germ cell tumor"@en,
        "pineal germ cell tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pineoblastoma rdfs:subClassOf :pineal_gland_cancer ;
    :has_definition "A pineal gland neoplasm located_in the brain." ;
    :has_exact_synonym "Pineal PNET"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spontaneous_tension_pneumothorax rdfs:subClassOf :pneumothorax ;
    :has_definition "A pneumothorax that is characterized by a pneumothorax in which the pressure of intrapleural gas exceeds atmospheric pressure resulting in acute onset chest pain and shortness of breath." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pneumothorax rdfs:subClassOf :pleural_disease ;
    :has_definition "A pleural disease that is characterized as an abnormal collection of air in the pleural space between the lung and the chest wall." ;
    :has_exact_match "MESH:D011030" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_interstitial_cystitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysuria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        :chronic_cystitis ;
    :has_definition "A chronic cystitis characterized by unpleasant sensation related to the bladder and lower urinary tract in the absence of identifiable causes and has_symptom pain, has_symptom pressure, has_symptom discomfort, has_symptom dysuria, and/or has_symptom urinary frequency." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cystitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :bladder_disease ;
    :has_definition "A bladder disease that is characterized by inflammation of the bladder." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_septal_defect rdfs:subClassOf :congenital_heart_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :heart_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cardiac_septum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Cardiac septal defects"@en,
        "Congenital septal defect of heart"@en,
        "septal defect"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_heart_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :heart_disease,
        :physical_disorder ;
    :has_exact_synonym "Congenital Heart Defects"@en,
        "Congenital anomaly of heart"@en,
        "Heart Malformation"@en,
        "congenital heart defect"@en,
        "heart defect"@en ;
    :has_related_synonym "Heart-congenital defect"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glaucoma rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease that is characterized by an unstable or a sustained increase in the intraocular pressure which the eye cannot withstand without damage to its structure or impairment of its function." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neovascular_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :ocular_hypertension ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_vision ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloodshot_eye ],
        :glaucoma ;
    :has_definition "A glaucoma characterized by narrowing of the anterior chamber angle secondary to neovascularization along the iris and iridocorneal angle such that the aqueous fluid outflow is blocked and intraocular pressure becomes inappropriately elevated leading to optic nerve damage and visual field loss. Neovascular glaucoma has_symptom progressive peripheral vision loss, decreased vision, and pain, redness, and headache in acute cases. Neovascular glaucoma can be related to abnormal angiogenesis with ischemic retinal diseases, inflammation, diabetes mellitus, intraocular malignancy, and autoimmune diseases." ;
    :has_exact_synonym "secondary angle-closure glaucoma with rubeosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuroendocrine_tumor rdfs:subClassOf :endocrine_gland_cancer ;
    :has_definition "An endocrine gland cancer that has_material_basis_in neuroendocrine cells." ;
    :has_exact_synonym "neuroendocrine neoplasm"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ichthyosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :epidermal_thickening ],
        :skin_disease ;
    :has_definition "A skin disease characterized by drying and scaling of skin with the accumulation of thick scales and cracks that may be painful or bleed." ;
    :has_exact_synonym "ichthyoses"@en,
        "non-syndromic ichthyosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:musculoskeletal_system_disease rdfs:subClassOf :disease_of_anatomical_entity ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :musculoskeletal_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease of anatomical entity that occurs in the muscular and/or skeletal system." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endocrine_gland_cancer rdfs:subClassOf :organ_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :endocrine_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system cancer located_in endocrine system that is characterized by uncontrolled cellular proliferation of the hormone producing glands of the endocrine system." ;
    :has_exact_synonym "Endocrine tumor"@en,
        "endocrine neoplasm"@en,
        "malignant Endocrine tumor"@en,
        "malignant neoplasm of endocrine gland"@en,
        "malignant tumour of endocrine gland"@en,
        "neoplasm of endocrine gland"@en,
        "neoplasm of endocrine system"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_ichthyosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :ichthyosis,
        :x_linked_recessive_disease ;
    :has_definition "An ichthyosis that is characterized by a build-up of scales on the skin, typically on the back of the neck and trunk resulting from skin cells that do not properly separate from the outermost surface of the skin, and has_material_basis_in X-linked recessive mutation or deletion of the STS gene on chromosome Xp22." ;
    :has_exact_synonym "X-linked ichthyosis with steryl-sulphatase deficiency"@en,
        "X-linked placental steryl-sulphatase deficiency"@en,
        "X-linked recessive ichthyosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:steroid_inherited_metabolic_disorder rdfs:subClassOf :lipid_metabolism_disorder ;
    :has_definition "A lipid metabolism disorder that involves defects in steroid metabolism." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ichthyosis_vulgaris rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ichthyosis ;
    :has_definition "An ichthyosis that has_material_basis_in heterozygous mutation in the filaggrin gene (FLG) on chromosome 1q21 and is characterized by dead skin cells accumulate in thick, dry scales on your skin's surface." ;
    :has_exact_synonym "Dominant congenital ichthyosiform erythroderma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:richter_s_syndrome rdfs:subClassOf :chronic_lymphocytic_leukemia ;
    :has_exact_synonym "Richter syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuroectodermal_tumor rdfs:subClassOf :nervous_system_cancer ;
    :has_exact_synonym "primitive Neuroectodermal neoplasm"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aortic_valve_stenosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_aortic_valve_physiology ],
        :aortic_valve_disease ;
    :has_definition "An aortic valve disease that is characterized by narrowing of the heart's aortic valve opening." ;
    :has_exact_match "MESH:D001024" ;
    :has_exact_synonym "Aortic stenosis"@en,
        "Rheumatic aortic stenosis"@en,
        "rheumatic aortic valve stenosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clear_cell_acanthoma rdfs:subClassOf :skin_benign_neoplasm ;
    :has_exact_synonym "Pale (Clear cell) acanthoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:duodenal_ulcer rdfs:subClassOf :peptic_ulcer_disease ;
    :has_exact_synonym "Curling Ulcer"@en,
        "Curling's ulcers"@en,
        "Stress Ulcer"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peritoneum_cancer rdfs:subClassOf :organ_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :peritoneum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system cancer that is located in the peritoneum." ;
    :has_related_synonym "cancer of peritoneum"@en,
        "peritoneal neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:partial_of_retinal_vein_occlusion rdfs:subClassOf :retinal_vein_occlusion ;
    :has_exact_synonym "Partial Retinal Vein Occlusion"@en,
        "Partial occlusion of retinal vein"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_vein_occlusion rdfs:subClassOf :retinal_vascular_occlusion,
        :vein_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :retinal_vascular_occlusion ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :central_retinal_vein ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Occlusion, of retinal vein"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retinal_vascular_occlusion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :retina ],
        :peripheral_vascular_disease,
        :retinal_vascular_disease ;
    :has_exact_synonym "Retinal vasc. occlusion"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eccrine_sweat_gland_neoplasm rdfs:subClassOf :sweat_gland_benign_neoplasm ;
    :has_exact_synonym "Eccrine tumor"@en,
        "eccrine skin neoplasm"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:histoplasmosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_appetite ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        :primary_systemic_mycosis ;
    :has_definition "A primary systemic mycosis that results in systemic fungal infection, has_material_basis_in Histoplasma capsulatum var capsulatum or has_material_basis_in Histoplasma capsulatum var duboisii, transmitted_by airborne spores and has_symptom nonproductive cough, has_symptom headache, has_symptom loss of appetite and has_symptom muscle pains." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cryptosporidiosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dehydration ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :intestine ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :cryptosporidium ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :coccidiosis,
        :intestinal_disease ;
    :has_definition "A coccidiosis that involves a parasitic protozoan infection of the intestine of humans and a wide range of animals caused by Cryptosporidium species, through contaminated water and food, The symptoms include watery diarrhea, dehydration, weight loss, abdominal pain, fever, nausea and vomiting. Cryptosporidium infections have also been found in other digestive tract organs, the lungs, and conjunctiva. Immunocompromised persons are at greater risk of developing the infection." ;
    :has_exact_synonym "Cryptosporidial gastroenteritis"@en,
        "Infection by Cryptosporidium"@en,
        "intestinal cryptosporidiosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:duodenal_benign_neoplasm rdfs:subClassOf :duodenum_disease,
        :small_intestine_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :duodenum ] ;
