    :has_definition "An epilepsy syndrome that is characterized by generalised seizures with no apparent cause which arise from many independent foci (multifocal epilepsies) or from epileptic circuits that involve the whole brain." ;
    :has_exact_synonym "Generalised epilepsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urethral_stricture rdfs:subClassOf :urethral_obstruction ;
    :has_exact_match "MESH:D14525" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diabetic_ketoacidosis rdfs:subClassOf :metabolic_acidosis ;
    :has_definition "A metabolic acidosis that is characterized by the shift of acid-base status of the body toward the acid side accompanied by the accumulation of ketone bodies in body tissues and fluids, resulting from uncontrolled diabetes mellitus." ;
    :has_exact_synonym "DIABETES MELLITUS, KETOSIS-PRONE"@en,
        "ketosis-prone diabetes mellitus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:menkes_disease rdfs:subClassOf :metal_metabolism_disorder ;
    :has_exact_synonym "COPPER TRANSPORT DISEASE"@en,
        "Menkes kinky-hair syndrome"@en,
        "steely hair syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bone_cancer rdfs:subClassOf :bone_disease,
        :connective_tissue_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :bone_element ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A connective tissue cancer that is located_in bone and is characterized by uncontrolled cellular proliferation that destroys normal bone tissue." ;
    :has_exact_synonym "CA - bone cancer"@en,
        "bone neoplasm"@en,
        "bone tumour"@en,
        "malignant bone neoplasm"@en,
        "malignant bone tumour"@en,
        "malignant neoplasm of bone"@en,
        "malignant osseous tumor"@en,
        "neoplasm of bone"@en,
        "osseous tumor"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mononeuritis_of_upper_limb rdfs:subClassOf :mononeuritis_of_upper_limb_and_mononeuritis_multiplex ;
    :has_exact_synonym "Mononeuritis upper limb"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cannabis_dependence rdfs:subClassOf :hallucinogen_dependence ;
    :has_definition "A drug dependence that involves the continued use of cannabis despite problems related to use of the substance." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intrahepatic_cholestasis rdfs:subClassOf :cholestasis ;
    :has_definition "A cholestasis characterized by impairment of the bile flow caused by obstruction located_in liver." ;
    :has_exact_synonym "neonatal intrahepatic cholestasis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cherubism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :skin_disease ;
    :has_definition "A bone disease characterized by replacement of bone in the jaws with fibrous tissue leding to facial swelling that has_material_basis_in heterozygous mutation in the SH3BP2 gene on chromosome 4p16.3." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mc_cune_albright_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by polyostotic fibrous dysplasia, precocious puberty, and caf-au-lait spots and has_material_basis_in spontaneous post zygotic missense mutation at ARG201 or Gln227 of the GNAS gene during embryogenesis." ;
    :has_exact_match "MESH:D005359" ;
    :has_exact_synonym "fibrous dysplasia of bone"@en,
        "osteitis fibrosa disseminata"@en,
        "polyostotic fibrous dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:jaw_cancer rdfs:subClassOf :bone_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :jaw_skeleton ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A bone cancer and jaw disease that is located in the jaw and results in a swollen jaw, results in numbness or a tingling sensation in jaw, and results in an abnormal growth of the jaw bone." ;
    :has_exact_synonym "neoplasm of jaw"@en ;
    :has_related_synonym "jaw neoplasm"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skull_cancer rdfs:subClassOf :bone_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :skull ] ;
                            rdf:rest :nil ] ] ] .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:giant_cell_reparative_granuloma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :granuloma ],
        :bone_giant_cell_tumor ;
    :has_exact_synonym "central giant cell (reparative) granuloma"@en,
        "central giant cell granuloma"@en,
        "central giant cell reparative granuloma of jaw"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:impotence rdfs:subClassOf :sexual_dysfunction ;
    :has_definition "A sexual dysfunction that is characterized by persistent or recurrent inability to achieve or to maintain an erection during sexual activity." ;
    :has_exact_synonym "Sexual impotence"@en,
        "erectile dysfunction"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sexual_dysfunction rdfs:subClassOf :male_reproductive_system_disease ;
    :has_definition "A male reproductive system disease that is characterized by disturbances in sexual desire or performance." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atrial_heart_septal_defect rdfs:subClassOf :heart_septal_defect ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :heart_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :interatrial_septum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A heart septal defect located_in in the septum that separates the two atria of the heart." ;
    :has_exact_synonym "atrial septal defect"@en,
        "atrioseptal defect"@en,
        "auricular septal defect"@en,
        "congenital atrial septal defect"@en,
        "interatrial septal defect"@en,
        "interauricular septal defect"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hepatitis_c rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :liver_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :acholic_stool ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :hepacivirus_hominis ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :jaundice ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_appetite ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in inflammation located_in liver, has_material_basis_in Hepacivirus hominis, which is transmitted_by blood from an infected person enters the body of an uninfected person. The infection has_symptom fever, has_symptom fatigue, has_symptom loss of appetite, has_symptom nausea, has_symptom vomiting, has_symptom abdominal pain, has_symptom clay-colored bowel movements, has_symptom joint pain, and has_symptom jaundice." ;
    :has_exact_synonym "NANBH"@en,
        "Viral hepatitis C"@en,
        "chronic hepatitis C"@en,
        "hepatitis C infection"@en,
        "hepatitis nonA nonB"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viral_hepatitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :viruses ],
        :hepatitis,
        :viral_infectious_disease ;
    :has_definition "A hepatitis that involves viral infection causing inflammation of the liver." ;
    :has_exact_synonym "Viral hepatitis with hepatic coma"@en,
        "animal viral hepatitis"@en,
        "human viral hepatitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:optic_nerve_disease rdfs:subClassOf :cranial_nerve_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :cranial_nerve_ii ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cranial nerve disease that is located_in the optic nerve." ;
    :has_exact_synonym "disorder of the second nerve"@en,
        "optic nerve disorder"@en,
        "optic neuropathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:noninfectious_dermatoses_of_eyelid rdfs:subClassOf :blepharitis ;
    :has_exact_synonym "Non-infected eyelid dermatoses"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allergic_contact_dermatitis_of_eyelid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :allergic_reaction ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eyelid ],
        :allergic_disease,
        :noninfectious_dermatoses_of_eyelid ;
    :has_definition "A noninfectious dermatoses of eyelid that is characterized by eczema, pruritis, or erythematous vesicles or papules of the eyelids, and has_material_basis_in a type IV hypersenstivity reaction to an allergen or irritant." ;
    :has_exact_synonym "Contact and allergic dermatitis of eyelid"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sigmoid_neoplasm rdfs:subClassOf :colonic_benign_neoplasm ;
    :has_exact_synonym "neoplasm of sigmoid colon"@en,
        "tumor of sigmoid colon"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vagina_sarcoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :embryonic_cell_metazoa_ ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vagina ],
        :sarcoma,
        :vaginal_cancer ;
    :has_definition "A vaginal cancer that has_material_basis_in connective tissue." ;
    :has_exact_synonym "sarcoma of the vagina"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_skin_fibrous_histiocytoma rdfs:subClassOf :malignant_dermis_tumor ;
    :has_exact_synonym "malignant fibrous histiocytoma of skin"@en,
        "vaginal melanoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_fibrous_histiocytoma rdfs:subClassOf :sarcoma ;
    :has_exact_synonym "Fibroxanthosarcoma"@en,
        "MFH"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:melanoma rdfs:subClassOf :cell_type_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :melanocyte ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cell type cancer that has_material_basis_in abnormally proliferating cells derives_from melanocytes which are found in skin, the bowel and the eye." ;
    :has_exact_match "MESH:D008545" ;
    :has_exact_synonym "Naevocarcinoma"@en,
        "malignant melanoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vaginal_yolk_sac_tumor rdfs:subClassOf :vaginal_cancer ;
    :has_definition "A vaginal cancer that is a primitive, malignant, germ cell tumor with histological features recapitulating various development phases of the normal yolk sac." ;
    :has_exact_synonym "vaginal Yolk Sac neoplasm"@en,
        "vaginal endodermal sinus neoplasm"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endodermal_sinus_tumor rdfs:subClassOf :germ_cell_cancer ;
    :has_definition "A germ cell cancer that has_material_basis_in cells that line the yolk sac of the embryo." ;
    :has_exact_synonym "yolk sac tumor",
        "Hepatoid yolk sac tumour"@en,
        "Yolk Sac neoplasm"@en,
        "Yolk sac tumour"@en,
        "endodermal sinus tumour"@en,
        "infantile embryonal carcinoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lesch_nyhan_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :purine_pyrimidine_metabolic_disorder,
        :x_linked_recessive_disease ;
    :has_definition "A purine-pyrimidine metabolic disorder characterized by mental retardation, spastic cerebral palsy, choreoathetosis, uric acid urinary stones, and self-destructive biting of fingers and lips that has_material_basis_in mutation in the hypoxanthine guanine phosphoribosyltransferase (HPRT) gene on chromosome Xq26." ;
    :has_exact_synonym "Complete hypoxanthine-guanine phosphoribosyltransferase deficiency"@en,
        "HG-PRT deficiency"@en,
        "Hypoxanthine-guanine phosphoribosyltransferase deficiency"@en,
        "Hypoxanthine-guanine-phosphoribosyltransferase deficiency"@en,
        "Lesch - Nyhan syndrome"@en,
        "X-linked hyperuricemia"@en,
        "deficiency of IMP pyrophosphorylase"@en,
        "hypoxanthine guanine phosphoribosyltransferase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sex_cord_gonadal_stromal_tumor rdfs:subClassOf :reproductive_organ_cancer ;
    :has_definition "A reproductive organ cancer that is located_in the sex cord-derived tissues of the ovary or testis and derives_from granulosa cells, Leydig cells, Sertoli cells, and fibroblasts." ;
    :has_exact_synonym "Sex Cord-Stromal neoplasm"@en,
        "Sex cord stromal tumour"@en,
        "Specialized gonadal neoplasm"@en,
        "Specialized gonadal tumor"@en,
        "Specialized gonadal tumour"@en,
        "sex cord-gonadal stromal tumour"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperuricemia rdfs:subClassOf :acquired_metabolic_disease ;
    :has_definition "An acquired metabolic disease that has_material_basis_in an abnormally high level of uric acid in the blood." ;
    :has_exact_synonym "Blood urate raized"@en,
        "uricacidemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:klinefelter_syndrome rdfs:subClassOf :chromosomal_duplication_syndrome ;
    :has_definition "A chromosomal duplication syndrome that is characterized by infertility and that has_material_basis_in an extra X chromosome in cells in men." ;
    :has_exact_synonym "47, XXY",
        "Hypogonadotropic Hypogonadism"@en,
        "Klinefelter's syndrome"@en,
        "XXY syndrome"@en,
        "XXY trisomy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:disorder_of_sexual_development rdfs:subClassOf :gonadal_disease ;
    :has_definition "A gonadal disease that is characterized by atypical development of chromosomal, gonadal, or anatomic sex." ;
    :has_exact_synonym "sex development disorder",
        "sex differentiation disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypogonadism rdfs:subClassOf :gonadal_disease ;
    :has_definition "A gonadal disease that is characterized by diminished functional activity of the gonads." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coffin_siris_syndrome rdfs:subClassOf :autosomal_dominant_intellectual_developmental_disorder,
        :syndrome ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :syndrome ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :digit_5 ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An autosomal dominant intellectual developmental disorder that is characterized by mental retardation associated with coarse facial features, hypertrichosis, sparse scalp hair, and hypoplastic or absent fifth fingernails or toenails." ;
    :has_exact_synonym "Dwarfism-Onychodysplasia"@en,
        "Fifth Digit Syndrome"@en,
        "Short Stature-Onychodysplasia."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gaucher_s_disease rdfs:subClassOf :sphingolipidosis ;
    :has_definition "A sphingolipidosis characterized by deficiency of the enzyme glucocerebrosidase which results in the accumulation of harmful quantities of the glycolipid glucocerebroside throughout the body, especially within the bone marrow, spleen and liver." ;
    :has_exact_synonym "Gaucher disease"@en,
        "acid beta-glucosidase deficiency"@en,
        "glocucerebrosidase deficiency"@en,
        "glucosylceramide beta-glucosidase deficiency"@en,
        "kerasin thesaurismosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sphingolipidosis rdfs:subClassOf :lipid_storage_disease ;
    :has_definition "A lipid storage disease characterized by functional deficiencies in the enzymes needed for lysosomal degradation of sphingolipid substrates." ;
    :has_exact_synonym "sphingolipidoses"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:williams_beuren_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :deletion ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :chromosome ] ;
                            rdf:rest :nil ] ] ],
        :autosomal_dominant_disease,
        :chromosomal_deletion_syndrome,
        :syndrome ;
    :has_definition "A syndrome that is characterized by mild to moderate intellectual disability, a broad forehead, a short nose with a broad tip, full cheeks, and a wide mouth with full lips and difficulty with visual-spatial tasks and has_material_basis_in hemizygous deletion of 1.5 to 1.8 Mb on chromosome 7q11.23." ;
    :has_exact_synonym "WBS",
        "Fanconi Schlesinger syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:supravalvular_aortic_stenosis rdfs:subClassOf :aortic_valve_stenosis ;
    :has_definition "An aortic valve stenosis that is characterized by a narrowing of the section of the aorta just above the valve that connects the aorta to the heart." ;
    :has_exact_synonym "Supra-valvular aortic stenosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:reproductive_organ_cancer rdfs:subClassOf :organ_system_cancer,
        :reproductive_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :reproductive_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system cancer that is manifested in the reproductive organs." ;
    :has_exact_synonym "Reproductive tumor"@en,
        "malignant reproductive system neoplasm"@en ;
    :has_related_synonym "cancer of reproductive system"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:laurence_moon_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by pituitary dysfunction, childhood onset ataxia, peripheral neuropathy, spastic paraplegia, and chorioretinopathy that has_material_basis_in homozygous or compound heterozygous mutation in the PNPLA6 gene on chromosome 19p13.2." ;
    :has_exact_synonym "LNMS"@en ;
    :has_related_synonym "Laurence-Moon-Biedl syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypothalamic_disease rdfs:subClassOf :brain_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :hypothalamus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A brain disease located_in the hypothalamus."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
