                                            rdf:rest [ rdf:first :loss_of_function_variant ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :loss_of_function_variant ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onClass :gene ;
                                                                    owl:onProperty :disease_has_location ;
                                                                    owl:qualifiedCardinality "1"^^xsd:nonNegativeInteger ] ;
                                                            rdf:rest :nil ] ] ] ;
