                                    rdf:rest [ rdf:first :vehicle_borne_medical_transmission ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :jaundice ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :liver_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :loss_of_appetite ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :acholic_stool ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :hepatitis_b_virus ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in inflammation located_in liver, has_material_basis_in Hepatitis B virus, which is transmitted_by sexual contact, blood transfusions, or fomites like needles or syringes. The infection has_symptom fever, fatigue, loss of appetite, nausea, vomiting, abdominal pain, clay-colored bowel movements, joint pain, and jaundice." ;
    :has_exact_synonym "chronic hepatitis B"@en,
        "hepatitis B infection"@en ;
    :has_related_synonym "Serum hepatitis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:drug_induced_hepatitis rdfs:subClassOf :hepatitis ;
    :has_exact_synonym "Drug-induced chronic hepatitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hepatitis_d rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :sleep_disturbance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lethargy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :jaundice ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :acholic_stool ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dark_urine ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :coma ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :liver_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anorexia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abnormal_behavior ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :drowsiness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :hepatitis_b_virus ;
                            rdf:rest [ rdf:first :hepatitis_delta_virus ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :confusion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in inflammation located_in liver, has_material_basis_in Hepatitis delta virus, which is an incomplete virus that requires the helper function of Hepatitis B virus to replicate and only occurs among people who are infected with the Hepatitis B virus. The infection has_symptom fatigue, has_symptom lethargy, has_symptom anorexia, has_symptom nausea, has_symptom jaundice, has_symptom clay-colored stools, has_symptom dark urine, has_symptom changes in personality, has_symptom disturbances in sleep, has_symptom confusion, has_symptom abnormal behavior, has_symptom somnolence, and has_symptom coma." ;
    :has_exact_synonym "delta hepatitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autoimmune_hepatitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :liver_inflammation ],
        :autoimmune_disease_of_gastrointestinal_tract ;
    :has_definition "An autoimmune disease of gastrointestinal tract that results_in inflammation located_in liver caused by the body's immune system attacking the liver cells." ;
    :has_exact_synonym "Autoimmune chronic active hepatitis"@en,
        "autoimmune hepatitis with centrilobular necrosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperostosis rdfs:subClassOf :bone_remodeling_disease ;
    :has_definition "A bone remodeling disease that results in an abnormal growth of located in bone." ;
    :has_exact_synonym "bone hypertrophy"@en,
        "hypertrophy of bone"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acute_maxillary_sinusitis rdfs:subClassOf :maxillary_sinusitis ;
    :has_definition "A maxillary sinusitis which lasts for less than 4 weeks." ;
    :has_exact_synonym "acute antritis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:maxillary_sinusitis rdfs:subClassOf :sinusitis ;
    :has_definition "A sinusitis which involves infection of maxillary sinuses that causes pain or pressure over the cheeks just below the eyes, tooth ache, and headache." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:post_traumatic_stress_disorder rdfs:subClassOf :anxiety_disorder ;
    :has_definition "An anxiety disorder which results from a traumatic experience that results in psychological trauma." ;
    :has_exact_synonym "PTSD",
        "traumatic neurosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chronic_mucocutaneous_candidiasis rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :nail ] ;
                            rdf:rest :nil ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :scarring ],
        :candidiasis,
        :nail_disease,
        :skin_disease ;
    :has_definition "A candidiasis that refers to a heterogeneous group of disorders characterized by recurrent or persistent superficial fungal infections located_in skin, located_in mucous membrane, or located_in nail due to T-cell defects, has-agent Candida species and has_symptom scaling of skin lesions, has_symptom thickening of nails, has_symptom swollen periungal tissue, and has_symptom scarring of the scalp." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_disease rdfs:subClassOf :female_reproductive_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :mammalian_vulva ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A female reproductive system disease that is located_in the vulva." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_multiple_exostoses rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :exostosis ;
    :has_definition "An exostosis that has_material_basis_in a mutation on the genes EXT1, EXT2 and EXT3 which results in multiple bony spurs throughout a child's growth." ;
    :has_exact_synonym "Multiple congenital exostosis"@en,
        "Multiple exostosis syndromes"@en,
        "Osteochondromatosis syndrome"@en,
        "hereditary multiple exostoses 1"@en,
        "hereditary multiple exostoses 2"@en,
        "hereditary multiple exostoses 3"@en,
        "multiple ostechondromas"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_nodular_hidradenoma rdfs:subClassOf :vulvar_benign_neoplasm ;
    :has_definition "A vulvar benign neoplasm that is characterized by nodules with cystic foci high in dermis on gross examination and derives_from the sweat gland distal excretory duct. Histologically characterized by nests or lobules of cells resembling eccrine poroma with either clear cytoplasm or prominent squamous metaplasia and lumina lined by cuboidal ductal cells or columnar secretory cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nodular_hidradenoma rdfs:subClassOf :hidradenoma ;
    :has_related_synonym "Eccrine nodular hidradenoma"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_syringoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :itching ],
        :vulvar_benign_neoplasm ;
    :has_definition "A vulvar benign neoplasm that is characterized by the comma tadpole shaped tail of dilated, cystic eccrine ducts, derives_from the eccrine sweat gland and presents as multiple, small, soft, skin-colored-to-yellowish papules, and has_symptom vulvar discomfort and has_symptom itching." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_angiokeratoma rdfs:subClassOf :vulvar_benign_neoplasm ;
    :has_definition "A vulvar benign neoplasm that is characterized by numerous ectatic blood vessels present in the superficial dermis." ;
    :has_exact_synonym "Fordyce angiokeratoma of vulva"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bartholin_s_gland_benign_neoplasm rdfs:subClassOf :vestibular_gland_benign_neoplasm ;
    :has_exact_synonym "Bartholin gland neoplasm"@en,
        "tumor of Bartholin's gland"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_squamous_tumor rdfs:subClassOf :vulva_cancer ;
    :has_definition "A vulva cancer that has_material_basis_in squamous tissue." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intestinal_perforation rdfs:subClassOf :intestinal_disease ;
    :has_exact_synonym "Perforation of intestine"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:minor_vestibular_glands_adenoma rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :derives_from ;
                            owl:someValuesFrom :epithelial_cell ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_origin ;
                                    owl:someValuesFrom :gland ] ;
                            rdf:rest :nil ] ] ],
        :adenoma,
        :vestibular_gland_benign_neoplasm ;
    :has_definition "A vestibular gland benign neoplasm that is located_in the minor vestibular glands and is composed_of epithelial tissue in which tumor cells form glands or glandlike structures." ;
    :has_related_synonym "adenoma of minor vestibular glands"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_glandular_tumor rdfs:subClassOf :vulva_cancer ;
    :has_definition "A vulva cancer that has_material_basis_in glandular tissue." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chondroid_syringoma_of_the_vulva rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :mammalian_vulva ],
        :eccrine_mixed_tumor_of_skin,
        :vulvar_benign_neoplasm .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eccrine_mixed_tumor_of_skin rdfs:subClassOf :eccrine_sweat_gland_neoplasm ;
    :has_exact_synonym "Eccrine mixed tumor"@en,
        "Eccrine mixed tumour"@en,
        "eccrine mixed tumour of skin"@en,
        "mixed Eccrine neoplasm of the skin"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_trichoepithelioma rdfs:subClassOf :vulvar_benign_neoplasm ;
    :has_definition "A vulvar benign neoplasm that derives_from epithelial-mesenchymal origin cells. It is characterized by branching nests of basaloid cells, horn cysts, and abortive hair papillae. The tumors represent benign hamartomas of the pilosebaceous apparatus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_melanoma rdfs:subClassOf :vulva_cancer ;
    :has_definition "A vulva cancer that has_material_basis_in melanocytes." ;
    :has_exact_synonym "malignant melanoma of vulva"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sweat_gland_cancer rdfs:subClassOf :skin_cancer,
        :sweat_gland_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :sweat_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "malignant neoplasm of sweat gland"@en,
        "malignant tumor of the Sweat gland"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulvar_sarcoma rdfs:subClassOf :vulva_cancer ;
    :has_definition "A vulva cancer that has_material_basis_in connective tissue." ;
    :has_exact_synonym "sarcoma of vulva"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulval_paget_s_disease rdfs:subClassOf :vulva_adenocarcinoma ;
    :has_definition "A vulva adenocarcinoma that is characterized by distinctive large cells with prominent cytoplasm, referred to as Paget cells and is an intraepithelial neoplasm of epithelial origin expressing apocrine or eccrine glandular-like features." ;
    :has_exact_synonym "Paget's disease of vulva"@en,
        "Vulvar Paget's disease"@en,
        "vulval Paget disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulva_adenocarcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :adenocarcinoma,
        :vulva_carcinoma ;
    :has_definition "A vulva carcinoma that derives_from epithelial cells of glandular origin." ;
    :has_exact_synonym "adenocarcinoma of Vulva"@en ;
    :has_related_synonym "adenocarcinoma of the vulva"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heel_spur rdfs:subClassOf :exostosis ;
    :has_definition "An exostosis that results_in an abnormal growth located_in calcaneus." ;
    :has_related_synonym "Calcaneal spur"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vulva_squamous_cell_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :mammalian_vulva ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :squamous_epithelial_cell ],
        :squamous_cell_carcinoma,
        :vulva_carcinoma ;
    :has_definition "A vulva carcinoma and has_material_basis_in squamous cells and is located_in the epidermis of the vulvar tissue." ;
    :has_exact_synonym "Vulvar Epidermoid carcinoma"@en,
        "vulvar squamous cell carcinoma"@en ;
    :has_related_synonym "squamous cell carcinoma of vulva"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myotonia_congenita rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :muscle_tissue_disease,
        :physical_disorder ;
    :has_definition "A muscle tissue disease that is characterized by slow muscle relaxation associated with hyperexcitation of the muscle fibres." ;
    :has_exact_synonym "Batten Turner congenital myopathy",
        "Thomsen and Becker disease" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cystoisosporiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_cramp ],
        :coccidiosis ;
    :has_definition "A coccidiosis that involves infection of the epithelial cells of the small intestine with Cystoisospora belli, which results in nonbloody diarrhea with crampy abdominal pain, malabsorption and weight loss." ;
    :has_exact_synonym "Infection by Isospora belli and Isospora hominis"@en,
        "Isosporosis"@en,
        "isosporiasis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coccidiosis rdfs:subClassOf :parasitic_protozoa_infectious_disease ;
    :has_definition "A parasitic protozoa infectious disease that occurs in the intestinal tract of animals and humans caused by Coccidia protozoa. Immunocompromised persons are at greater risk of developing the infection." ;
    :has_related_synonym "intestinal coccidiosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:b_cell_deficiency rdfs:subClassOf :primary_immunodeficiency_disease ;
    :has_definition "A primary immunnodeficiency disease that is caused by a lack of infection-fighting antibody producing B cells (immunoglobulins) or B cells that are not functioning properly." ;
    :has_exact_synonym "B cell (antibody) deficiencies"@en,
        "Immunoglobulin heavy chain deficiency"@en,
        "immunoglobulin heavy chain deletion"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:focal_dermal_hypoplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_dominant_inheritance ],
        :syndrome,
        :x_linked_dominant_disease ;
    :has_definition "A syndrome characterized at birth by streaks of very thin skin (dermal hypoplasia), cutis aplasia, and telangiectases, and has_material_basis_in heterozygous mutation in the PORCN gene on chromosome Xp11.23." ;
    :has_exact_synonym "FDH"@en,
        "FODH"@en,
        "Goltz syndrome"@en,
        "Goltz-Gorlin syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ectodermal_dysplasia rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome characterized by abnormal development in 2 or more ectodermal structures (hair, nails, teeth, and sweat glands) without other systemic findings." ;
    :has_exact_synonym "Congenital ectodermal defect"@en,
        "Congenital ectodermal dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pneumonic_tularemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :lung ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :breathing_problems ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :airborne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :lung_disease,
        :tularemia ;
    :has_definition "A tularemia that is located_in lungs. The bacteria are transmitted_by breathing dusts or aerosols containing the organisms. The infection has_symptom cough, has_symptom chest has_symptom pain, and has_symptom difficulty breathing." ;
    :has_exact_synonym "Pneumonic tularaemia"@en,
        "bronchopneumonic tularemia"@en,
        "pulmonary tularemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tularemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :chrysops ;
                            rdf:rest [ rdf:first :dermacentor_variabilis ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vector_borne_bite_transmission ;
                                    rdf:rest [ rdf:first :insect_borne_transmission ;
                                            rdf:rest [ rdf:first :tick_borne_transmission ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :francisella_tularensis ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that has_material_basis_in Francisella tularensis, which is transmitted by dog tick bite (Dermacentor variabilis), transmitted by deer flies (Chrysops sp) or transmitted by contact with infected animal tissues." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brain_germinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :germ_cell ],
        :brain_cancer,
        :germ_cell_cancer ;
    :has_definition "A brain cancer that is characterized by abnormally proliferating cells, derives_from germ cells." ;
    :has_exact_synonym "germinoma of the brain"@en,
        "intracranial germinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atypical_teratoid_rhabdoid_tumor rdfs:subClassOf :brain_cancer ;
    :has_definition "A brain cancer that is usually located in the brain, but can occur anywhere in the central nervous system." ;
    :has_exact_synonym "Atypical teratoid/rhabdoid tumor"@en,
        "Atypical teratoid/rhabdoid tumour"@en,
        "Rhabdoid tumor of the CNS"@en,
        "Rhabdoid tumour of the CNS"@en,
        "atypical teratoid rhabdoid tumour"@en ;
    :has_related_synonym "AT/RT"@en,
