                                    owl:someValuesFrom :basilar_artery ] ;
                            rdf:rest :nil ] ] ] ;
    :has_exact_synonym "Basilar artery syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:factor_xii_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :blood_coagulation_disease ;
    :has_definition "A blood coagulation disease that is characterized by prolonged PTT time without clinical symptoms, and has_material_basis_in a mutation in the F12 gene on chromosome 5q33." ;
    :has_exact_synonym "Factor XII deficiency disease"@en,
        "Hageman Factor deficiency"@en,
        "deficiency, Hageman"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

