    :has_exact_synonym "localisation-related epilepsy"@en,
        "partial epilepsy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prothrombin_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :thrombophilia ;
    :has_definition "A thrombophilia that is characterized by bleeding symptoms due to low levels of circulating prothrombin, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the gene encoding coagulation factor II, also known as prothrombin, on chromosome 11p11." ;
    :has_exact_synonym "Congenital factor II deficiency",
        "Hereditary factor II deficiency disease",
        "hypoprothrombinemia"@en ;
    :has_related_synonym "Factor II deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_afibrinogenemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :blood_coagulation_disease,
        :physical_disorder ;
    :has_definition "A blood coagulation disease that is characterized by an impaired blood clotting resulting from a lack deficiency of a the fibrinogen protein (coagulation factor I)." ;
    :has_exact_synonym "Factor I deficiency"@en,
        "Fibrinogen deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

