    :has_exact_synonym "TIA"@en,
        "TIA - Transient ischaemic attack"@en,
        "Transient cerebral ischaemia"@en,
        "Transient ischemic attacks"@en,
        "transient ischemic attack"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spondylosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        :bone_structure_disease,
        :spinal_disease ;
    :has_definition "A bone structure disease that involves degeneration between vertebra located_in vertebral column." ;
    :has_exact_synonym "Lumbar spondylosis with myelopathy"@en,
        "Spondylogenic compression of lumbar spinal cord"@en,
        "Spondylogenic compression of thoracic spinal cord"@en,
        "Thoracic or lumbar spondylosis with myelopathy"@en,
        "lumbosacral spondylosis without myelopathy"@en,
        "spondylosis with myelopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:syndrome rdfs:subClassOf :disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_basis_in ;
                                    owl:someValuesFrom :symptom ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A disease characterized by a group of signs and symptoms that occur together and characterize a particular abnormality." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cervix_disease rdfs:subClassOf :uterine_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :uterine_cervix ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An uterine disease that is located_in the cervix." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

