                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_phenotype ;
                                    owl:someValuesFrom :skeletal_dysplasia ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A bone development disease that results_in defective development of cartilage or bone." ;
    :has_exact_synonym "skeletal dysplasia",
        "Cartilage Development disorder"@en,
