            owl:onProperty :has_symptom ;
            owl:someValuesFrom :low_grade_fever ],
        :upper_respiratory_tract_disease ;
    :has_definition "An upper respiratory tract disease involving inflammation of the throat or pharynx resulting from bacterial, viral, fungal infections or irritants like pollutants or chemical substances and smoking. The infection is often referred to as sore throat. The symptoms include pain during swallowing, enlarged tonsils coated with a white discharge, runny nose, cough and slight fever." ;
    :has_exact_synonym "Inflamed throat"@en,
        "Persistent sore throat"@en,
        "Pharyngeal disorder"@en,
        "Pharyngitis - acute"@en,
        "Sore throat - chronic"@en,
        "acute pharyngitis"@en,
        "acute sore throat"@en,
        "chronic pharyn/nasopharyngitis"@en,
        "chronic pharyngitis"@en,
        "chronic pharyngitis and nasopharyngitis"@en,
        "chronic sore throat"@en ;
    :has_related_synonym "pharyngeal disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
