        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abscess ],
        :hidradenitis ;
    :has_definition "A hidradenitis that is characterized by chronic inflammation of the apocrine sweat glands, has_symptom painful nodules, abscesses, sinus tract formation, scarring, erythema, pruritis, and pain, and has_material_basis_in chronic inflammation of the apocrine sweat glands leading to recurrent folliculitis and an accompanying immune response that worsens inflammation." ;
    :has_exact_synonym "Acne inversa, familial"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

