@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leptospirosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :leptospira ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :left_upper_quadrant_abdominal_rigidity ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :contact_transmission ;
                            rdf:rest [ rdf:first :vehicle_borne_ingestion_transmission ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :jaundice ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that involves systemic infection, has_material_basis_in Leptospira, which is transmitted by contact with water, food, or soil containing urine from the infected animals. The infection has symptom jaundice, has symptom chills, has symptom fever, has symptom muscle pain, and has symptom hepatomegaly." ;
    :has_exact_synonym "Fort Bragg fever"@en,
        "Leptospirosis icterohaemorrhagica"@en,
        "Rat Catcher's Yellows"@en,
        "Weil's disease"@en,
