    :has_exact_synonym "Ischaemic encephalopathy"@en,
        "Ischemic encephalopathy"@en,
        "cerebral ischemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:obstructive_lung_disease rdfs:subClassOf :lung_disease ;
    :has_definition "A lung disease that is characterized by narrowing of pulmonary airways." ;
    :has_exact_synonym "respiratory airway obstruction"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

