    :has_exact_synonym "cholera morbus"@en,
        "infectious colitis, enteritis and gastroenteritis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

