            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :epithelial_cell ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_origin ;
                                            owl:someValuesFrom :gland ] ;
                                    rdf:rest :nil ] ] ] ],
        :adenocarcinoma,
        :colon_carcinoma ;
    :has_definition "A colon carcinoma that derives_from epithelial cells of glandular origin." ;
    :has_exact_synonym "Colonic adenocarcinoma"@en,
        "adenocarcinoma of colon"@en ;
    :has_related_synonym "adenocarcinoma of the colon"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:craniosynostosis rdfs:subClassOf :synostosis ;
    :has_definition "A synostosis that results_in premature fusion located_in skull." ;
    :has_exact_synonym "Premature closure of cranial sutures"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polyclonal_hypergammaglobulinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hypergammaglobulinemia ],
        :plasma_protein_metabolism_disease .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plasma_protein_metabolism_disease rdfs:subClassOf :inherited_metabolic_disorder ;
    :has_definition "An inherited metabolic disorder that involves plasma protein metabolism malfunction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:monoclonal_paraproteinemia rdfs:subClassOf :plasma_protein_metabolism_disease ;
    :has_exact_synonym "Monoclonal paraproteinaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:generalized_atherosclerosis rdfs:subClassOf :atherosclerosis ;
    :has_exact_synonym "Generalised atherosclerosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arteriosclerotic_cardiovascular_disease rdfs:subClassOf :arteriosclerosis ;
    :has_exact_synonym "Cardiovascular arteriosclerosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arteriosclerosis rdfs:subClassOf :artery_disease ;
    :has_definition "An artery disease that is characterized by a thickening and hardening of arterial walls in the arteries." ;
    :has_exact_synonym "Arteriosclerotic vascular disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colonic_benign_neoplasm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :colon ],
        :colonic_disease,
        :intestinal_benign_neoplasm,
        :lymphangioma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :lymphangioma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :colon ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An intestinal benign neoplasm that is located_in the colon." ;
    :has_exact_synonym "Colonic Mass"@en,
        "Colonic tumor"@en,
        "colon neoplasm"@en,
        "neoplasm of colon"@en .

