    :has_exact_synonym "disorder of iron metabolism"@en,
        "iron disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hemochromatosis rdfs:subClassOf :metal_metabolism_disorder ;
