    :has_exact_synonym "Haemochromatosis"@en,
        "diabetes bronze"@en,
        "iron storage disorder"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myelophthisic_anemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anemia ],
        :aplastic_anemia ;
    :has_definition "An aplastic anemia that is characterized by displacement of hemopoietic bone-marrow tissue either by fibrosis, tumors or granulomas." ;
    :has_exact_synonym "ANEMIA LEUKOERYTHROBLASTIC"@en,
        "Anemia, leukoerythroblastic"@en,
        "Leukoerythroblastosis"@en ;
    :has_related_synonym "myelophthisis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anemia rdfs:subClassOf :hematopoietic_system_disease ;
    :has_definition "A hematopoietic system disease that is characterized by a decrease in the normal number of red blood cells." ;
    :has_exact_match "MESH:D000740" ;
    :has_exact_synonym "anaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:macrocytic_anemia rdfs:subClassOf :anemia ;
    :has_exact_synonym "ANEMIA MACROCYTIC"@en,
        "Macrocytic anaemia"@en .
